// ==UserScript==
// @name          Ctrl + Alt + B 로 소리 증폭 (범용)
// @namespace     Ctrl + Alt + B 로 소리 증폭 (범용)
// @match         *://*/*
// @version       0.1
// @description   Ctrl + Alt + B 로 사이트의 미디어 볼륨을 조절 가능합니다, 기존 https://greasyfork.org/ko/scripts/460929 스크립트를 사용을 그만해주시기 바랍니다. (유튜브 사이트에는 해당 스크립트의 원리와 같은 원리가 적용됨, 타 사이트는 다른 원리가 사용됨.)
// @icon          data:image/png;base64,
// @author        mickey90427 <mickey90427@naver.com>
// @license       MIT
// @downloadURL https://update.greasyfork.org/scripts/501580/Ctrl%20%2B%20Alt%20%2B%20B%20%EB%A1%9C%20%EC%86%8C%EB%A6%AC%20%EC%A6%9D%ED%8F%AD%20%28%EB%B2%94%EC%9A%A9%29.user.js
// @updateURL https://update.greasyfork.org/scripts/501580/Ctrl%20%2B%20Alt%20%2B%20B%20%EB%A1%9C%20%EC%86%8C%EB%A6%AC%20%EC%A6%9D%ED%8F%AD%20%28%EB%B2%94%EC%9A%A9%29.meta.js
// ==/UserScript==

(function() {
    'use strict';

    let isBoosted = false;
    let gainValue = 1; // 기본 증폭 비율
    const originalVolume = 1;

    // 사이트별 볼륨 증폭 비율 제한
    const maxVolume = window.location.hostname === 'www.youtube.com' ? 10 : 16;

    // 볼륨 증폭 기능
    function boostVolume(video, boost) {
        let audioContext = video.audioContext;
        let gainNode = video.gainNode;

        if (!audioContext) {
            audioContext = new (window.AudioContext || window.webkitAudioContext)();
            let source = audioContext.createMediaElementSource(video);
            gainNode = audioContext.createGain();
            source.connect(gainNode);
            gainNode.connect(audioContext.destination);
            video.audioContext = audioContext;
            video.gainNode = gainNode;

            video.addEventListener('play', () => {
                audioContext.resume();
            }, { once: true });
        }

        gainNode.gain.value = boost ? gainValue : originalVolume;
    }

    // 증폭 적용 기능
    function applyVolumeBoost() {
        isBoosted = true;
        let videos = document.querySelectorAll('video');
        videos.forEach(video => {
            boostVolume(video, true);
        });
    }

    // 증폭 해제 기능
    function removeVolumeBoost() {
        isBoosted = false;
        let videos = document.querySelectorAll('video');
        videos.forEach(video => {
            boostVolume(video, false);
        });
    }

    // 새로운 비디오에 대해 적용
    function applyToNewVideos() {
        let videos = document.querySelectorAll('video');
        videos.forEach(video => {
            if (!video.dataset.volumeBoosted) {
                boostVolume(video, isBoosted);
                video.dataset.volumeBoosted = true;
            }
        });
    }

    // MutationObserver를 사용하여 새로운 비디오 요소 감지
    let observer = new MutationObserver(() => {
        applyToNewVideos();
    });

    observer.observe(document.body, { childList: true, subtree: true });

    // 통합 GUI 생성
    function createUnifiedDialog() {
        const dialog = document.createElement('div');
        dialog.style.position = 'fixed';
        dialog.style.top = '50%';
        dialog.style.left = '50%';
        dialog.style.transform = 'translate(-50%, -50%)';
        dialog.style.padding = '20px';
        dialog.style.backgroundColor = '#333';
        dialog.style.color = '#fff';
        dialog.style.border = '1px solid #444';
        dialog.style.borderRadius = '8px';
        dialog.style.boxShadow = '0 0 10px rgba(0, 0, 0, 0.5)';
        dialog.style.zIndex = '10000';
        dialog.style.display = 'none';

        const input = document.createElement('input');
        input.type = 'number';
        input.value = gainValue;
        input.min = 1;
        input.max = maxVolume;
        input.style.width = '100px';
        input.style.padding = '5px';
        input.style.marginRight = '10px';
        input.style.border = '1px solid #444';
        input.style.borderRadius = '4px';
        input.style.backgroundColor = '#555';
        input.style.color = '#fff';
        dialog.appendChild(input);

        const applyButton = document.createElement('button');
        applyButton.textContent = '적용';
        applyButton.style.marginLeft = '10px';
        applyButton.style.padding = '5px 10px';
        applyButton.style.border = 'none';
        applyButton.style.borderRadius = '4px';
        applyButton.style.backgroundColor = '#4CAF50';
        applyButton.style.color = '#fff';
        applyButton.style.cursor = 'pointer';
        applyButton.onclick = () => {
            let newValue = parseFloat(input.value);
            if (newValue >= 1 && newValue <= maxVolume) {
                gainValue = newValue;
                applyVolumeBoost();
            } else {
                alert(`증폭 비율은 1에서 ${maxVolume} 사이로 설정해주세요.`);
            }
        };
        dialog.appendChild(applyButton);

        const removeButton = document.createElement('button');
        removeButton.textContent = '해제';
        removeButton.style.marginLeft = '10px';
        removeButton.style.padding = '5px 10px';
        removeButton.style.border = 'none';
        removeButton.style.borderRadius = '4px';
        removeButton.style.backgroundColor = '#f44336';
        removeButton.style.color = '#fff';
        removeButton.style.cursor = 'pointer';
        removeButton.onclick = () => {
            removeVolumeBoost();
        };
        dialog.appendChild(removeButton);

        const closeButton = document.createElement('button');
        closeButton.textContent = '닫기';
        closeButton.style.marginLeft = '10px';
        closeButton.style.padding = '5px 10px';
        closeButton.style.border = 'none';
        closeButton.style.borderRadius = '4px';
        closeButton.style.backgroundColor = '#777';
        closeButton.style.color = '#fff';
        closeButton.style.cursor = 'pointer';
        closeButton.onclick = () => {
            dialog.style.display = 'none';
        };
        dialog.appendChild(closeButton);

        document.body.appendChild(dialog);
        return dialog;
    }

    const unifiedDialog = createUnifiedDialog();

    // 키보드 이벤트 리스너 추가
    document.addEventListener('keydown', (event) => {
        if (event.ctrlKey && event.altKey && event.key === 'b') {
            if (unifiedDialog.style.display === 'none') {
                unifiedDialog.style.display = 'block';
            } else {
                unifiedDialog.style.display = 'none';
            }
        }
    });

    // 초기 실행
    applyToNewVideos();
})();
